    for our nightly bingo games which are required under State law not reimbursement
    to the non-federal account. Rent for our nightly bingo games is assessed at the
    usual and normal charge. The maximum allowable rents are set by the State of Michigan
    Charitable Gaming Division of the Michigan Lottery based on requirements of the
    bingo hall.  We pay the maximum rent allowable by the Charitable Gaming Division
    which is $585 per night in one hall and $620 per night in the other hall. Expenditures
